import React from "react";

function CountryJumbotron({ children }) {
  return (
    <div
      style={{ height: 100, clear: "both", paddingTop: 120, textAlign: "center", backgroundImage: "https://via.placeholder.com/750x500.jpg" }}
      className="jumbotron"
    >
      {children}
    </div>
  );
}

export default CountryJumbotron;
